    false,nt"url": null,nt"notes": "Three Flavobacterium columnare isolates
    which had been obtained from dying adult suckers at Upper Klamath Lake during a
    fish kill in August, 1996 and stored by lyophilization were chosen for use in bacterial
    challenge experiments. Two of the isolates were from gill lesions on an adult Lost
    River sucker and a shortnose sucker (Chasmises brevirostris). The third F. columnare
    isolate was obtained from lesions in the mouth of an adult Lost River sucker. Preliminary
    F. columnare challenge experiments were conducted in September and October, 1999
    at the Corvallis Salmon Disease Laboratory. These experiments were designed to determine
    an effective bacterial exposure method for infecting juvenile Lost River suckers
    that could be used for the University of Wyoming challenges of suckers exposed to
    water with four sublethal ammonia concentrations.",nt"license_title": "License
